import React, { useState } from 'react'

function CounterExample(){
    const [count, setCount] = useState(0);

    return(
        <div>
            <h1>{count}</h1>
            <h1 onClick={() => setCount(count + 1)}>
                Plus
            </h1>
            <h1 onClick={() => setCount(count - 1)}>
                Minus
            </h1>
        </div>
    )
}

function changeState(){
    const [name] = useState(0);
    return(
        <h1>
            {name + 100}
        </h1>
    )
}

export default CounterExample
